import React from "react";
import { Typography, Box, Button, Avatar } from "@material-ui/core";
import { Formik } from "formik";

const Index = () => {
  return (
    <div >
      <Box
        style={{
        marginTop:"10%",
        marginLeft:"450px",

        textAlign:"center",
         width:"400px",
         height:"350px",
         backgroundColor:"#F7F7F7"

        }}
      >
        <Typography style={{ fontSize:"40px" ,marginTop:"20px"}}>Log in </Typography>
      </Box>
    </div>
  );
};
export default Index;
